            "photo_column_number":item.photo_column_number,
            "photo_path":item.photo_path,
            "category_id":item.category_id,
            "job_id" : job_id.job.id

        });

        let sql = await createInsertQuery(res);

        const sqlInsert = await insertQuery(sql);

        // console.log(sql);

    })
    // console.log(res);
    // return res;
}

