    return axios
    .get(url, {
      responseType: 'arraybuffer'
    })
    .then(response => Buffer.from(response.data, 'binary').toString('base64'))
  }

const getJobId = async (param) =>{

    const config = {
        headers: {
            "Content-Type" : "application/json",
            "Authorization" : "NODEFLUX-HMAC-SHA256 Credential=HZGJ4NNS48TTTOVMOK71YDNR6/20200819/nodeflux.api.v1beta1.ImageAnalytic/StreamImageAnalytic, SignedHeaders=x-nodeflux-timestamp, Signature=5c647dbcf50217f0a2f918a23764e277d144c8e2049516ecfb788ae0287b75b3",
            "x-nodeflux-timestamp": "20200819T075030Z"
        }
    }

    const raw_lama_kebaruan = `{
        "additional_params":{
            "template": [[1, 2, 4], [3,4,5]]
        },
        "images": [
            ${param}
        ]
    }`
    try{
        // console.log(raw_lama_kebaruan);
        const rr = await axios.post(`https://api.cloud.nodeflux.io/v1/analytics/scjohnson-sku-recognition`
            , raw_lama_kebaruan
            , config);
        // console.log("t")
        // console.log(rr);
        return rr.data;
    }
    catch(e){

        // console.log(e);
        return e;
    }
}
